@Override
public SeekStatus seekCeil(BytesRef term) throws IOException {
  assert term.isValid();
  SeekStatus result = super.seekCeil(term);
  if (result == SeekStatus.END) {
    state = State.UNPOSITIONED;
  } else {
    state = State.POSITIONED;
  }
  return result;
}

